import React from 'react';
import { gql, useQuery } from '@apollo/client';

/*
  GraphQL
*/
const GET_SUBMISSIONS = gql`
  query {
    getAllSubmissions{
    _id
    score
    strength
    weakness
  }
}
`;

/*
  Component
*/
export default function Admin(){
  const {data} = useQuery(GET_SUBMISSIONS);
  console.log(data);

  return(
    <div>
      Admin UI
    </div>
  );
};
